Polkaswap vedlikeholdes av SORA -samfunnet. Før du bruker Polkaswap -funksjonalitet, vennligst les %%Polkaswap FAQ%% og dokumentasjon, som inneholder en detaljert forklaring på hvordan Polkaswap fungerer, samt Polkaswap -notatet og vilkårene for bruk og personvernerklæring. Disse dokumentene er avgjørende for en sikker og positiv brukeropplevelse. Ved å bruke Polkaswap, erkjenner du at du har lest og forstått disse dokumentene. 

 Du anerkjenner også følgende: 

 1) ditt eneste ansvar for overholdelse av alle lover som kan gjelde for din spesielle bruk av Polkaswap i din juridiske jurisdiksjon;
 2) din forståelse av at den nåværende versjonen av Polkaswap er en alfa -versjon: den er ikke fullstendig testet, og noen funksjoner fungerer kanskje ikke som designet;
 3) din forståelse og frivillig aksept av risikoen ved bruk av Polkaswap, inkludert, men ikke begrenset til, risikoen for å miste tokens. Nok en gang, ikke fortsett uten å lese FAQ, Polkaswap Memorandum og vilkår for tjenester og personvernerklæring!

